@Vagabondhero @MFA_China It is a natural part of the occupation policy.
It is natural to prepare for contingencies.
The actions of the U.S. military would be justified.

@JamesDJBrown Murata Seisakusho and Nihondensan, etc. are going to build much more branch factories in China.
US should BAN imports of their products and exclude them out of US supply chains completely.
This is the best way to deter China's invasion to Taiwan.
